import Card from 'react-bootstrap/Card';

export default function Foto(){
    return (
        <div>
            <Row>
            <h1>Rafaela Viana</h1>
                                <h4>Programadora Web</h4>
            </Row>
             <Row>
                    <Col md={5}>
                    <h4>Ol√°!
                        
                    </h4>
